import * as React from "react";
import { Box, Button, Heading} from "@chakra-ui/react";

function QuoteCheck() {
    return (
        <Box p="5">
            <Heading as="h1" size="x1">Quote Check</Heading>
            <Button mt="2" colorScheme="blue" as="a" href="/">Go back</Button>
        </Box>
    )
}

export default QuoteCheck;
